import React from 'react';
import styled from "styled-components";
import { PortfolioCard } from "./PortfolioCard";
import poems from "./poems.png";
import music from "./music.png"



export const Portfolio = () => {

  const cards = [
    {
      image: <img src={poems}/>
      ,
    }, 
    {
      image: <img src={music}/>,

    }, 
    {
      title: "Update plan", 
      description: " I will help you keep it updated",
      icon: <i class="fas fa-hand-holding-heart"></i>,
    }
  ];

  return(
<Main>
<h1>This is what I've done</h1>


<Section id="portfolio">


      {cards.map((card) => 
        <PortfolioSection>

  <PortfolioCard value= {card.title}
  text ={card.description}
  icon ={card.icon}
  image = {card.image} />

</PortfolioSection>

  )}

  )
</Section>
</Main>
  )
}

const Main = styled.div`
background-color: rgba(0, 0, 0, 0.8);

text-align: center; 
padding-top: 100px; 
`

const Section = styled.div`
min-height: 100vh; 
box-sizing: border-box;
justify-content: center; 
align-items: center;  
display: flex; 
padding-bottom: 100px; 
`

const PortfolioSection =styled.div`
box-sizing: border-box;
display: flex;
justify-content: center; 
padding-bottom: 50px;

`
